import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import loginComp from "./components/login/loginComp";
import forgotYourPasswordComp from "./components/login/forgotYourPasswordComp";
import SendEmail from "./components/login/sendEmailComp";

export default function App() {
  const Stack = createStackNavigator();
  return (
    <>
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen name="Login" component={loginComp} />
          <Stack.Screen
            name="Forgot your password"
            component={forgotYourPasswordComp}
          />
        </Stack.Navigator>
      </NavigationContainer>
      {/* <View style={styles.container}>
        <Text>nhjkj</Text>
        {/* <loginComp></loginComp> 
        {/* <ForgotYourPasswordComp></ForgotYourPasswordComp> 
        {/* <SendEmail></SendEmail> 
        {/* <StatusBar style="auto" /> 
      </View> */}
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
